func convert(thing string) int {
	kek, err := strconv.Atoi(thing)
	if err != nil {
		return 1
	}
	return kek

}

func convertAll(strings []string) []int {
	var final []int
	for _, num := range strings {
		kek, err := strconv.Atoi(num)
		if err != nil {

		} else {
			final = append(final, kek)
		}
	}
	return final
}

func format(input string, tosplit string) []string {
	return strings.Split(input, tosplit)
}

func replaceAtIndex(in string, r string, i int) string {
	out := strings.Split(in, "")
	//fmt.Println(out)
	out[i] = r
	return strings.Join(out, "")
}

func solve(input []string) int {
	var total = 0
	var allthewaydown = len(input)
	var over = 0
	for i := 0; i < allthewaydown+1; i++ {
		if i+1 <= allthewaydown-1 {

			if over+3 > (len(input[i]) - 1) {
				over = over + 3 - (len(input[i]))
			} else {
				over = over + 3
			}
			var newting = i + 1
			var kek = strings.Split(input[newting], "")
			if kek[over] == "#" {
				total++
			} else if kek[over] == "." {
			} else {
				fmt.Println("IDK MAN OMG")
			}
		}

	}
	return total
}

func solve2(input []string, rightSlope []int, downSlope []int) []int {
	var totals = []int{}
	var allthewaydown = len(input)
	var over = 0
	for l := 0; l < len(rightSlope); l++ {
		var mult = rightSlope[l]
		var mult2 = downSlope[l]
		var num = 0

		for i := 0; i < allthewaydown+1; i = i + mult2 {

			if i+mult2 <= allthewaydown-1 {

				if over+mult > (len(input[i]) - 1) {
					over = over + mult - (len(input[i]))
				} else {
					over = over + mult
				}
				var newting = i + mult2
				if over == 3 {
					var kek = strings.Split(input[newting], "")
					if kek[over] == "#" {
						num++
					} else if kek[over] == "." {
					} else {
						fmt.Println("IDK MAN OMG")
					}

				} else {
					var kek = strings.Split(input[newting], "")
					if kek[over] == "#" {
						num++
					}
				}
			}
		}
		over = 0
		totals = append(totals, num)
	}
	return totals
}

